import React from 'react';
import ReactDOM from 'react-dom';
// import world, {love, myName} from './App';
import * as list from "./App";
ReactDOM.render(
    <>
        <ul>
            <li>My world is</li>
            <li>{list.default}</li>
            <li>My love is</li>
            <li>{list.love}</li>
            <li>My name is</li>
            <li>{list.myName()}</li>
            <li>h</li>
        </ul>
    </>,
    document.getElementById('root')
)
